import Foundation


func firstUniqChar(_ s: String) -> Int {
    let letters = ["a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"]
    var clone = [Character]()
    var count = [Character: Int]()
    var position = [Character: Int]()
    
    for i in 0 ..< s.count {
        var index = s.index(s.startIndex, offsetBy: i)
        count[s[index], default: 0] += 1
        if position[s[index]] == nil {
            position[s[index]] = i
        }
    }
    
    
    for char in letters {
        if position[Character(char)] != nil {
            clone.append(Character(char))
        }
    }
    
    for i in 0 ..< clone.count {
        for j in i+1 ..< clone.count{
            if position[clone[i]]! > position[clone[j]]! {
                var swap = clone[i]
                clone[i] = clone[j]
                clone[j] = swap
            }
        }
    }
    
    for char in clone {
        if count[char] == 1  {
            return position[char]!
        }
    }
    
    
    return -1
}


firstUniqChar("")
